import "./Item.css";
function Item(props) {
  const day = props.date.toLocaleString("en-us", { day: "2-digit" });
  const month = props.date.toLocaleString("en-us", { month: "long" });
  const year = props.date.getFullYear();
  return (
    <div className="basic">
      <center>
        <h1 className="head">EXPENSE TRACKER</h1>
      </center>
      <div className="item">
        <p className="date">
          DATE : {day} {month} {year}
        </p>
        <p className="name">Car Insurance</p>
        <p className="price">$200</p>
      </div>
      <br></br>
      <div className="item">
        <p className="date">DATE : 21/12/2022</p>
        <p className="name">Property Insurance</p>
        <p className="price">$500</p>
      </div>
      <br></br>
      <div className="item">
        <p className="date">DATE : 21/12/2022</p>
        <p className="name">Travelling</p>
        <p className="price">$100</p>
      </div>
      <br></br>
    </div>
  );
}
export default Item;
